using GreenWhale.Extensions.TestTools2.Extensions;
using Microsoft.VisualStudio.TestTools.UnitTesting;
namespace GreenWhale.Extensions.TestStudio.UnitTest
{
    [TestClass]
    public class ScriptRunUnitTest
    {
        [TestMethod]
        public void FrameValidate()
        {
            ScriptRun scriptRun = new ScriptRun();
            var res=  scriptRun.FrameValidate(new RunTime.Scripts.InvokeContext() {SourceFrame= "AA14A102024F4B5355".ToHex()});
            Assert.IsTrue(res.State == RunTime.Scripts.State.FrameValidatePassed);
        }
        [TestMethod]
        public void Invoke()
        {
            ScriptRun scriptRun = new ScriptRun();
            var res = scriptRun.Invoke(new RunTime.Scripts.InvokeContext() { SourceFrame = "".ToHex() });
            Assert.IsTrue(res.State == RunTime.Scripts.State.Qualified);
        }
    }
}
